import styled from 'styled-components'

// Create a Title component that'll render an <h1> tag with some styles
const NavBar_style = styled.div`
  width: 100%;
  height: 50px;
  background-color: blue;
  border-Width: 1;
    border-Radius: 2;
    border-Color: '#ddd';
    elevation: 1;
    margin-Left: 5;
    margin-Right: 5;
    margin-Top: 10;
`;


export default NavBar_style;
